import React, { useEffect, useState } from 'react';
import './css/FeaturedMatches.css';
import axios from 'axios';

const FeaturedMatches = () => {
  const [allMatches, setAllMatches] = useState([]);
  const [stages, setStages] = useState([]);
  const [activeStageId, setActiveStageId] = useState(null);
  const [loading, setLoading] = useState(true);

useEffect(() => {
  if (loading || !Array.isArray(matches)) return;

  const live = [];
  const upcoming = [];
  const completed = [];

  const now = Date.now();
  const next24h = now + 48 * 60 * 60 * 1000;

  matches.forEach(m => {
    const matchDate = new Date(m.starting_at);
    const isLive = liveStatuses.includes(m.status);
    const isUpcoming = upcomingMatchStatuses.includes(m.status) &&
      matchDate >= new Date(now) && matchDate <= new Date(next24h);
    const isCompleted = completedMatchStatuses.includes(m.status) &&
      matchDate >= new Date(now - 2 * 24 * 60 * 60 * 1000);

    if (isLive) live.push(m);
    else if (isUpcoming) upcoming.push(m);
    else if (isCompleted) completed.push(m);
  });

  const sortByDate = (a, b) => new Date(a.starting_at) - new Date(b.starting_at);
  live.sort(sortByDate);
  upcoming.sort(sortByDate);
  completed.sort(sortByDate);

  const stageMatchMap = {};
  const stageList = new Set();
  const allFiltered = [];

  const processMatches = (matchArray, maxPerStage) => {
    for (const match of matchArray) {
      const displayStage = getDisplayStageName(match);
      stageList.add(displayStage);
      stageMatchMap[displayStage] = stageMatchMap[displayStage] || [];

      if (maxPerStage === Infinity || stageMatchMap[displayStage].length < maxPerStage) {
        stageMatchMap[displayStage].push(match);
        allFiltered.push(match);
      }
    }
  };

  processMatches(live, Infinity);
  processMatches(upcoming, 2);
  processMatches(completed, 2);

  setFilteredMatches(allFiltered); // All filtered but not per-stage yet
  setStages(Array.from(stageList));
}, [matches, loading]);


  const filteredMatches = allMatches.filter((match) => {
    const isLive =
      match?.status === 'LIVE' ||
      match?.status === 'Break' ||
      match?.status === 'Lunch' ||
      match?.status === 'Dinner' ||
      match?.status === 'Delayed' ||
      match?.status === 'Interrupted';
    return isLive;
  });

  const visibleMatches = filteredMatches.filter((match) => {
    if (!activeStageId) return true;
    return match.stage?.id === activeStageId;
  });

  if (loading) return <div>Loading matches...</div>;

  return (
    <div className="featured-matches">
      <div className="stage-tabs">
        <span
          className={`tab ${activeStageId === null ? 'active-tab' : ''}`}
          onClick={() => setActiveStageId(null)}
        >
          All
        </span>
        {stages.map((stage) => (
          <span
            key={stage.id}
            className={`tab ${activeStageId === stage.id ? 'active-tab' : ''}`}
            onClick={() => setActiveStageId(stage.id)}
          >
            {stage.label}
          </span>
        ))}
      </div>

      <div className="matches-container">
        {visibleMatches.length === 0 ? (
          <div className="no-matches">No matches available</div>
        ) : (
          visibleMatches.map((match) => (
            <div key={match.id} className="match-card">
              <div className="match-header">
                {match.stage?.name} - {match.venue?.name}
              </div>
              <div className="teams">
                <div className="team">{match.localteam?.name}</div>
                <div className="vs">vs</div>
                <div className="team">{match.visitorteam?.name}</div>
              </div>
              <div className="status">{match.status}</div>
            </div>
          ))
        )}
      </div>
    </div>
  );
};

export default FeaturedMatches;
